query:
DELETE FROM properties 
WHERE id NOT IN (
  SELECT MIN(id) 
  FROM (
    SELECT MIN(id) as id
    FROM properties
    GROUP BY addressLine1, city, state, zipcode
  ) as keep_ids
);

